import React from "react";
import { Link, withRouter } from "react-router-dom";
function Header(props) {
  return (
    <header>
      <div className='header-inner'>
        <Link className='logo'>Ian M.</Link>
        <nav>
          <ul>
            <li>
              <a href='/'>about</a>
            </li>
            <li>
              <a href='/'>Work</a>
            </li>
            <li className='btn'>
              <a href='/'>Contact</a>
            </li>
          </ul>
        </nav>
      </div>
    </header>
  );
}
export default withRouter(Header);
